		"text": "올해 5회를 맞은 캘린더 갤러리는 오프라인 행사로만 진행해왔는데요, 직접 방문이 어려우셨던 분들이 분명 있을 거라는 생각과 저희 나름의 5주년 기념 이벤트를 해보자는 생각, 창작자분들의 달력을 더 많이 알리고픈 생각에 퍼스널 쇼퍼 이벤트를 기획했습니다. https://t.co/DiDTFB1gmS"
